    false,nt"url": null,nt"notes": "The imagery posted on this site is of the
    Atlantic coast of Florida after Hurricane Jeanne made landfall. The regions photographed
    range along a 100-mile stretch from Melbourne to Palm Beach, Florida. The flights
    to collect the Florida detailed imagery were conducted between September 26 and
    October 1. The images were acquired from an altitude of 7,000 feet, using an Emerge/Applanix
    Digital Sensor System (DSS). Over 1,200 images of the Florida coastline affected
    by Hurricane Jeanne are available to view online and download.",nt"owner_org":
